    false,nt"url": null,nt"notes": "This narrative report for Lostwood National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1962.
    The report begins by summarizing the weather conditions, water conditions, food
    and cover, and wildfires during this period. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, and raptors-
    is also covered. The Refuge development and maintenance section discusses physical
    developments,collections and receipts, and vegetation control. Resource management
    is outlined; topics include grazing. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, and safety. Items
    of interest, photographs, and N-R forms are attached.",nt"license_title": "License
